import {GetToken, Get_TShirts} from "../Services/ApiConsumer"
import { useState } from "react"

export default function ShowStock()
{
    const [data, setData] = useState([])
    setData(ShowStock())
    return(
        <>
            {data.map((Stock) => (
                <li key={Stock.Id}>
                    {Stock.Name} {Stock.Size}
                </li>
            ))}
        </>
    )
}
